import React from 'react';

const ErrorMessage = ({ message, onClose }) => {
  return (
    <div className="alert alert-danger alert-dismissible fade show m-3" role="alert">
      {message}
      <button
        type="button"
        className="btn-close"
        aria-label="Close"
        onClick={onClose}
      ></button>
    </div>
  );
};

export default ErrorMessage;
